import React from 'react';
import { Form, Input, Button } from 'antd';

const PostForm = () => {
  return (
    <Form style={{ margin: '10px 0 20px' }} encType="multipart/form-data">
    <Input.TextArea maxLength={500} placeholder="<어제 한 일>" style={{ height: '100px'}}>{'<어제한일>'}}</Input.TextArea>
    <Input.TextArea maxLength={500} placeholder="<오늘 할 일>" style={{ height: '100px'}}/>
    <Input.TextArea maxLength={500} placeholder="<어제의 문제점>" style={{ height: '100px'}}/>
    <div>
      <Button type="primary" style={{ float: 'right', backgroundColor: '#00001a', borderColor: '#00001a' }} htmlType="submit">발행</Button>
    </div>
  </Form>
  )
}

export default PostForm;
